    solution = Solution()

    # Generate a random expression
    operators = ['-', '+', '*']
    expression = ''
    for _ in range(random.randint(1, 10)):
        expression += str(random.randint(0, 9))
        expression += random.choice(operators)
    expression += str(random.randint(0, 9))

